// Use for reciving the bid and showing to users
// Xinmeng Wu 4.8
// up to date - wxm
import React, { useEffect, useState } from 'react';
import axios from 'axios';

function BidReceive({ vin, refreshKey }) {
  const [bids, setBids] = useState([]);

  useEffect(() => {
    if (!vin) return;  // 如果没有VIN，不执行请求

    const fetchBids = async () => {
      try {
        const url = `${process.env.REACT_APP_API_URL}api/receive_bid/`;
        const response = await axios.get(url, {
          params: { vin }  // 请求与VIN匹配的出价
        });
        setBids(response.data);
      } catch (error) {
        console.error('Error fetching bids:', error);
      }
    };

    fetchBids();
  }, [vin, refreshKey]);  // 当vin或refreshKey变化时重新执行

  return (
    <div className="bid-receive-container">
      <h2>Bids for VIN: {vin}</h2>
      {bids.length > 0 ? (
        <ul>
          {bids.map((bid, index) => (
            <li key={index}>
              Bid ID: {bid.bid_id}, User ID: {bid.user}, Auction ID: {bid.auction}, 
              Bid Amount: {bid.bid_amount}, VIN: {bid.vin}, Bid Time: {bid.bid_time}, 
              Bid Win: {bid.bidwin ? 'Yes' : 'No'}
            </li>
          ))}
        </ul>
      ) : (
        <p>No bids found for this VIN.</p >
      )}
    </div>
  );
}

export default BidReceive;
